Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.parallelize(Seq(
      ("query1", 1614979200),
      ("query2", 1614982800),
      ("query1", 1614986400),
      ("query3", 1614990000),
      ("query2", 1614993600),
      ("query1", 1614997200)
    )).toJavaRDD

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.parallelize(Seq("query1", "query2")).toJavaRDD

    // Broadcast top frequent queries
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Calculate hit rate
    val hitRate = onsiteData.mapPartitions(iter => {
      val cache: mutable.Map[String, (Long, Boolean)] = mutable.Map()
      iter.map { case (query, timestamp) =>
        if (broadcastTopQueries.value.contains(query)) {
          val cacheEntry = cache.getOrElseUpdate(query, (timestamp, false))
          val isHit = cacheEntry._2 || (timestamp - cacheEntry._1) <= 12 * 60 * 60
          cache.put(query, (timestamp, isHit))
          (isHit, 1)
        } else {
          (false, 0)
        }
      }
    }).reduce((a, b) => (a._1 || b._1, a._2 + b._2))

    // Print hit rate
    println(s"Hit rate: ${hitRate._1}, Total queries: ${hitRate._2}")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries into `JavaRDD`s. It then broadcasts the top frequent queries to all executors using `broadcast()`.

Next, it calculates the hit rate by mapping each partition of the onsite attributed data. For each query in the partition, it checks if it is in the top frequent queries. If it is, it checks if the query is in the cache and if it is a hit or miss. If the query is not in the cache or if it is a miss, it sends a request to retrieve the query and caches it for 12 hours. It then updates the cache with the new query and timestamp.

Finally, it reduces the results from all partitions to calculate the overall hit rate and total number of queries. The hit rate is calculated as the number of hits divided by the total number of queries.

